             name: 'Yeonkyu'
        }
        console.log('Lifecycle A constructor')
    }

    static getDerivedStateFromProps(props, state) {
        console.log('LifecycleA getDerivedStateFromProps ')
        return null
    }

    componentDidMount() {
        console.log('LifecycleA componentDidMount')
    }
    
    render() {
        console.log('LifeCycleA render')
        return (
            <div>
                <div>Lifecycle A  </div>  
                <LifecycleB />  
            </div>
        )
    }
}

